@TCPHtweets has partnered with the @FortWorthZoo to make COVID-19 vaccinations available on half-price Wednesday’s on July 14, 28 and August 4 from 9 to 11 a.m. 
All three vaccinations will be avail; Children 12 and older are eligible. 
